import React, { useState, useEffect } from 'react';
import { 
  Box, Typography, Button, Container, Card, CardContent, Grid, 
  Accordion, AccordionSummary, AccordionDetails, Paper, CardMedia, CardActions 
} from '@mui/material';
import { styled } from '@mui/system';
import { motion } from "framer-motion";
import { ParallaxProvider, Parallax as ParallaxReact } from 'react-scroll-parallax';
import ScrollProgressBar from 'react-scroll-progress-bar';
import ChevronRightIcon from '@mui/icons-material/ChevronRight';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';
import { green } from '@mui/material/colors';
import Typist from 'react-typist';
import CommentIcon from '@mui/icons-material/Comment';
import StarIcon from '@mui/icons-material/Star';
import HistoryIcon from '@mui/icons-material/History';
import NoMeetingRoomIcon from '@mui/icons-material/NoMeetingRoom';
import CleanHandsIcon from '@mui/icons-material/CleanHands';
import TimerIcon from '@mui/icons-material/Timer';
import AttachMoneyIcon from '@mui/icons-material/AttachMoney';
import CurrencyBitcoinIcon from '@mui/icons-material/CurrencyBitcoin';
import BusinessIcon from '@mui/icons-material/Business';
